function toggleDropdown(e){for(elementToToggle=e.nextElementSibling,allDropdowns=document.getElementsByClassName("dropdown-content"),i=0;i<allDropdowns.length;i++)elementToToggle!=allDropdowns[i]&&allDropdowns[i].classList.contains("show")&&allDropdowns[i].classList.toggle("show");elementToToggle.classList.toggle("show")}function filterFunction(e){var l,o,n;for(l=e.value.toUpperCase(),div=e.nextElementSibling,o=div.getElementsByTagName("a"),n=0;n<o.length;n++)o[n].innerHTML.toUpperCase().indexOf(l)>-1?o[n].style.display="":o[n].style.display="none"}